SELECT COUNT(*) AS total
             FROM receivables_db.report_orders
             WHERE TRY(
             CAST(
                date_parse(TRIM("contract start date"), '%Y-%m-%d %I:%i %p') AS TIMESTAMP
             )
                 ) BETWEEN date_trunc('day', current_timestamp AT TIME ZONE 'America/New_York')
             AND 
             date_trunc('day', current_timestamp AT TIME ZONE 'America/New_York') + interval '1' day;

SELECT COUNT(*) AS total
FROM receivables_db.report_orders
WHERE status IN ('IN TRANSIT', 'WAITING SHIPMENT', 'DELIVERED')
  AND TRY(
    CAST(
      date_parse(TRIM("contract start date"), '%Y-%m-%d %I:%i %p') AS TIMESTAMP
    )
  ) BETWEEN date_trunc('day', current_timestamp AT TIME ZONE 'America/New_York')
      AND date_trunc('day', current_timestamp AT TIME ZONE 'America/New_York') + interval '1' day;

SELECT COUNT(*) AS total
FROM receivables_db.report_orders
WHERE status IN ('IN TRANSIT', 'WAITING SHIPMENT', 'DELIVERED')
  AND TRY(
    CAST(
      date_parse(TRIM("contract start date"), '%Y-%m-%d %I:%i %p') AS TIMESTAMP
    )
  ) BETWEEN date_trunc('month', current_timestamp AT TIME ZONE 'America/New_York')
      AND date_trunc('month', current_timestamp AT TIME ZONE 'America/New_York') + interval '1' month - interval '1' day;

SELECT COUNT(*) AS total
    FROM receivables_db.report_orders
    WHERE TRY(
            CAST(
                date_parse(TRIM("contract start date"), '%Y-%m-%d %I:%i %p') AS TIMESTAMP
            )
        ) BETWEEN date_trunc('month', current_timestamp AT TIME ZONE 'America/New_York')
        AND date_trunc('month', current_timestamp AT TIME ZONE 'America/New_York') + interval '1' month - interval '1' day;

SELECT COUNT(*) AS total
    FROM receivables_db.report_orders
    WHERE status = 'WAITING SIGN';

SELECT COUNT(*) AS total
    FROM receivables_db.report_orders
    WHERE status = 'PDD';

SELECT SUM(COALESCE("remaining total", 0)) AS valor_a_receber
    FROM receivables_db.report_orders
    WHERE status IN ('DELIVERED', 'IN TRANSIT', 'WAITING SHIPMENT');

